class JwtClient {
    token = "";

    authenticate(username, password) {
        var body = {
            username: username,
            password: password,
        };

        var myHeaders = new Headers();

        var init = {
            method: "POST",
            headers: myHeaders,
            mode: "cors",
            cache: "default",
        };

        fetch("https://localhost:8443/login", body).then((resp) => {
            console.log(resp.data);
        });
    }
}

export default JwtClient;
